import React from 'react';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { Document, Packer, Paragraph, Table, TableCell, TableRow } from 'docx';
import { saveAs } from 'file-saver';

function ResultsTable({ projectData }) {
    const { tasks } = projectData || {};
    if (!tasks || !Array.isArray(tasks)) {
        return <p>No tasks available to display.</p>;
    }

    // Export to PDF
    const exportToPDF = () => {
        const doc = new jsPDF();

        // Title
        doc.setFontSize(16);
        doc.text('Project Task Details', 14, 20);

        // Generate table data
        const tableData = [];
        tasks.forEach(({ task, subtasks }) => {
            // Add a row for the task
            tableData.push([task, '', '', '']);

            // Add rows for subtasks
            subtasks.forEach(({ subtask, hours, comments }) => {
                tableData.push(['', subtask, `${hours} hours`, comments || 'N/A']);
            });
        });

        // Generate table
        autoTable(doc, {
            head: [['Task', 'Subtask', 'Development Hours', 'Comments']],
            body: tableData,
            startY: 30,
            margin: { left: 14, right: 14 },
            headStyles: { fillColor: [41, 128, 185], textColor: 255 },
            bodyStyles: { textColor: 50 },
            alternateRowStyles: { fillColor: [240, 240, 240] },
            tableWidth: 'auto',
        });

        // Save the PDF
        doc.save('Project_Estimates.pdf');
    };

    // Export to DOCX
    const exportToDOCX = () => {
        const rows = [];

        tasks.forEach(({ task, subtasks }) => {
            // Add a row for the task
            rows.push(
                new TableRow({
                    children: [
                        new TableCell({ children: [new Paragraph(task)] }),
                        new TableCell({ children: [new Paragraph('')] }),
                        new TableCell({ children: [new Paragraph('')] }),
                        new TableCell({ children: [new Paragraph('')] }),
                    ],
                })
            );

            // Add rows for subtasks
            subtasks.forEach(({ subtask, hours, comments }) => {
                rows.push(
                    new TableRow({
                        children: [
                            new TableCell({ children: [new Paragraph('')] }),
                            new TableCell({ children: [new Paragraph(subtask)] }),
                            new TableCell({ children: [new Paragraph(`${hours} hours`)] }),
                            new TableCell({ children: [new Paragraph(comments || 'N/A')] }),
                        ],
                    })
                );
            });
        });

        const doc = new Document({
            sections: [
                {
                    children: [
                        new Paragraph({ text: 'Project Task Details', heading: 'Heading1' }),
                        new Table({
                            rows: [
                                // Table header
                                new TableRow({
                                    children: [
                                        new TableCell({ children: [new Paragraph('Task')] }),
                                        new TableCell({ children: [new Paragraph('Subtask')] }),
                                        new TableCell({ children: [new Paragraph('Development Hours')] }),
                                        new TableCell({ children: [new Paragraph('Comments')] }),
                                    ],
                                }),
                                ...rows,
                            ],
                        }),
                    ],
                },
            ],
        });

        Packer.toBlob(doc).then((blob) => {
            saveAs(blob, 'Project_Estimates.docx');
        });
    };

    return (
        <div className="results-table">
            <h3>Project Task Details</h3>
            <table>
                <thead>
                    <tr>
                        <th>Task</th>
                        <th>Subtask</th>
                        <th>Development Hours</th>
                        <th>Comments</th>
                    </tr>
                </thead>
                <tbody>
                    {tasks.map((taskItem, taskIndex) =>
                        taskItem.subtasks.map((subtask, subIndex) => (
                            <tr key={`${taskIndex}-${subIndex}`}>
                                <td>{subIndex === 0 ? taskItem.task : ''}</td>
                                <td>{subtask.subtask}</td>
                                <td>{subtask.hours} hours</td>
                                <td>{subtask.comments || 'N/A'}</td>
                            </tr>
                        ))
                    )}
                </tbody>
            </table>
            <div className="actions">
                <button onClick={exportToPDF}>Export to PDF</button>
                <button onClick={exportToDOCX}>Export to DOCX</button>
            </div>
        </div>
    );
}

export default ResultsTable;
